import React , { Component } from 'react';

import ReactBootstrap, {Nav, Button, Navbar,NavDropdown,Form,FormControl} from 'react-bootstrap'
import 'bootstrap/dist/css/bootstrap.min.css';
import './Header.css'


class Header extends Component{
	render(){
		
		return(
				

<div>
				<Navbar bg="white" expand="lg">
			
				  <Navbar.Toggle aria-controls="basic-navbar-nav" />
				  <Navbar.Collapse id="basic-navbar-nav">
				    <Nav className="mr-auto">
				      <a href="#"> <img src={ require('./images.png') } /> </a>
				      <Nav.Link href="#db">Admin Database</Nav.Link>
				      <Nav.Link href="#acc">Create Account</Nav.Link>
				     </Nav>
				     <Nav className="ml-auto">
				     <img src={ require('./download.png') } /> 
				      <NavDropdown id="basic-nav-dropdown" style={{margin:"1000 px"}}>
				        <NavDropdown.Item href="#action/3.1">Action</NavDropdown.Item>
				        <NavDropdown.Item href="#action/3.2">Another action</NavDropdown.Item>
				        <NavDropdown.Item href="#action/3.3">Something</NavDropdown.Item>
				        <NavDropdown.Divider />
				        <NavDropdown.Item href="#action/3.4">Separated link</NavDropdown.Item>
				      </NavDropdown>
				      <h3>Uzma</h3>
				    </Nav>
				    
				  </Navbar.Collapse>
				</Navbar>
				</div>

    );
			
	}
}

export default Header;

